import { createRoot} from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import './PureJava';

// const root = ReactDOM.createRoot(document.getElementsByTagName('body'));
// root.render(
//   <React.StrictMode>
//     <App />
//   </React.StrictMode>
